import React from 'react';


function NavBar() {

  return(
    <div className="restaurant-NavBar">
      <h1 className="heading-home home restuarnt">Uber <span className="heading-eats restuarnt">Eats</span></h1>
      <ul className="nav justify-content-end">
        <li className="nav-item">
        <a className="nav-link active" onClick="editProfile" aria-current="page" href="http://localhost:3000/Edit.jsx">Edit Profile</a>
        </li>
        <li className="nav-item">
        <a className="nav-link active" onClick="editProfile" aria-current="page" href="http://localhost:3000/RestaurantLanding.jsx">Profile</a>
        </li>
        <li className="nav-item">
        <a className="nav-link" href="http://localhost:3000/">LogOut</a>
        </li>
      </ul>
    </div>
  )
}

export default NavBar;
